import React from "react";
import "./style.css";

function Modal() {
    return (
        <div className="modal">
            <div className="modal-container">
                <button id="close"><i class="fas fa-times"></i></button>
                <input type="text" name="search" placeholder="Search.."></input>
            </div>
        </div>
    );
}

export default Modal;
